import "./App.css";
import { useState } from "react";

function App() {
  const [result, setResult] = useState();

  function countAndPrintResult(number) {
    const resultValue = count(number);
    setResult(resultValue);
  }

  function count(number) {
    return 2 * number;
  }

  return (
    <div className="App">
      <label>
        number:
        <input type="text" name="number" />
      </label>
      <input type="submit" value="Submit" />
      <button onClick={countAndPrintResult}>Press me to calculate</button>
      <textarea value={result} readOnly></textarea>
    </div>
  );
}

export default App;
